import React from 'react';
import { useNavigate } from 'react-router-dom';
import headbg from './Images/header_bg.jpg'; 
import wesafelogo from './Images/wesafe_Logo.png';
import userprofile from './Images/avatar.png'
import toggle from './Images/toggle_menu.png'

const Header = ({ userProfile, onToggleSidebar }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Add your logout logic here (clear tokens, update state, etc.)
    navigate('/');
  };

  return (
    <div className="bg-cover bg-no-repeat bg-center h-20 flex items-center" style={{ backgroundImage: `url(${headbg})` }}>
      <button onClick={onToggleSidebar} className="text-white ml-4">
        <img src={toggle} alt = 'Toggle Button'></img>
      </button>
      
      <img src={wesafelogo} alt="Company Logo" className="h-12 mx-4" />

      <div className="flex-grow"></div> {/* This pushes the next items to the right */}

      <img src={userprofile} alt="User Profile" className="h-12 rounded-full mx-4" />

      <button onClick={handleLogout} className="text-white mr-4">
        Logout
      </button>
    </div>
  );
};

export default Header;
